		// Return the lowest of two Decimal inputs.
		function decimalMin(x, y) {
			x = new Decimal(x);
			y = new Decimal(y);
			if (x.greaterThanOrEqualTo(y)) {
				result = y;
			} else {
				result = x;
			}
			return result;
		}
		
		// Return the largest of two Decimal inputs.
		function decimalMax(x, y) {
			x = new Decimal(x);
			y = new Decimal(y);
			if (x.greaterThanOrEqualTo(y)) {
				result = x;
			} else {
				result = y;
			}
			return result;
		}
		
